async function fetchJSONFile(e){try{var t=await fetch("JS/data.json");if(!t.ok)throw new Error("Network response was not ok");e(await t.json())}catch(e){console.error("Error fetching or parsing JSON file:",e)}}fetchJSONFile(t=>{let o=0;var r=document.querySelectorAll(".summary-icon"),n=document.querySelectorAll("#summary-content h2 > span:last-child");for(let e=0;e<4;e++)document.querySelector(`#summary-${t[e].category.toLowerCase()} > p > span:first-child`).textContent=t[e].score,r[e].src=t[e].icon,n[e].textContent=t[e].category,o+=t[e].score;e=Math.round(o/400*100),document.querySelector("#result-circel > span:first-child").textContent=e,document.querySelector("#main-component").classList.remove("hidden");var e=(90<=e?"Excellent":65<=e&&"Great")||(50<=e?"Good":"Failed");document.querySelector("#result-contnet > h2").textContent=e,document.querySelector("#result-contnet > p").textContent={Excellent:"You scored higher than 90% of the people who have taken these tests.",Great:"You scored higher than 65% of the people who have taken these tests.",Good:"You scored higher than 50% of the people who have taken these tests.",Failed:"You scored lower than 50% Please try again."}[e]});